(function($){"use strict";$(".has-spinner").click(function(){const btn=$(this);$(btn).buttonLoader("start");setTimeout(function(){$(btn).buttonLoader("stop")},3e3)});Ladda.bind(".button-demo button",{timeout:2e3});Ladda.bind(".progress-demo button",{callback:function(instance){let progress=0;const interval=setInterval(function(){progress=Math.min(progress+Math.random()*.1,1);instance.setProgress(progress);if(progress===1){instance.stop();clearInterval(interval)}},200)}})})(jQuery);